// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.6;

import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

contract ERC721Auction is Context, IERC721Receiver, ReentrancyGuard {
    using SafeMath for uint256;
    using Address for address;

    /// @notice Event emitted only on construction. To be used by indexers
    event AuctionContractDeployed();
    event AuctionCreated(uint256 indexed tokenId);
    event AuctionEnded(uint256 indexed tokenId);

    event BidPlaced(
        uint256 indexed tokenId,
        address indexed bidder,
        uint256 bidAmount
    );

    event FundWithdrawn(
        uint256 indexed tokenId,
        address indexed owner,
        uint256 withdrawAmount
    );

    event FundReturned(
        uint256 indexed tokenId,
        address indexed owner,
        uint256 returnAmount
    );

    /// @notice Parameters of an auction
    struct Auction {
        address owner;
        uint256 startPrice;
        uint256 startTime;
        uint256 endTime;
        uint256 fee; // percent
        address fundTokenAddress;
        bool created;
    }

    /// @notice Information about the sender that placed a bid on an auction
    struct Bid {
        address bidder;
        uint256 bidAmount;
        uint256 actualBidAmount;
        uint256 bidTime;
    }

    /// @notice ERC721 Token ID -> Auction Parameters
    mapping(uint256 => Auction) public auctions;
    mapping(uint256 => uint256) public availableFunds;

    /// @notice ERC721 Token ID -> bidder info (if a bid has been received)
    mapping(uint256 => Bid[]) public bids;



    /// @notice ERC721 NFT
    IERC721 public token;

    /**
     * @notice Auction Constructor
     * @param _tokenAddress erc721 token address
     */
    constructor(
        address _tokenAddress
    ) {
        require(_tokenAddress != address(0), "Invalid NFT");

        token = IERC721(_tokenAddress);

        emit AuctionContractDeployed();
    }

    modifier onlyCreatedAuction(uint256 _tokenId) {
        require(
            auctions[_tokenId].created == true,
            "Auction.onlyCreatedAuction: Auction does not exist"
        );
        _;
    }

    modifier onlyAuctionOwner(uint256 _tokenId) {
        require(
            auctions[_tokenId].owner == _msgSender(),
            "Auction.onlyAuctionOwner: not auction owner"
        );
        _;
    }

    /**
     * @notice Creates a new auction for a given token
     * @dev Only the owner of a token can create an auction and must have approved the contract
     * @dev End time for the auction must be in the future.
     * @param _tokenId Token ID of the token being auctioned
     * @param _startTimestamp Unix epoch in seconds for the auction start time
     * @param _endTimestamp Unix epoch in seconds for the auction end time.
     * @param _fee percent which will be paid as a fee to the individual who provides the hightest loan amount
     */
    function createAuction(
        uint256 _tokenId,
        uint256 _startPrice,
        uint256 _startTimestamp,
        uint256 _endTimestamp,
        uint256 _fee,
        address _fundTokenAddress
    ) external {
        // Check owner of the token is the creator and approved
        require(
            token.isApprovedForAll(token.ownerOf(_tokenId), address(this)),
            "Auction.createAuction: Owner has not approved"
        );
        require(
            token.ownerOf(_tokenId) == _msgSender(),
            "Auction.createAuction: Caller is not the owner"
        );

        _createAuction(_tokenId, _startPrice,_startTimestamp, _endTimestamp, _fee, _fundTokenAddress);

        emit AuctionCreated(_tokenId);
    }

    /**
     * @notice Places a new bid, out bidding the existing bidder if found and criteria is reached
     * @dev Only callable when the auction is open
     * @dev Bids from smart contracts are prohibited to prevent griefing with always reverting receiver
     * @param _tokenId Token ID of the token being auctioned
     */
    function placeBid(uint256 _tokenId, uint256 _bidAmount)
        external
        nonReentrant
        onlyCreatedAuction(_tokenId)
    {
        require(
            _msgSender().isContract() == false,
            "Auction.placeBid: No contracts permitted"
        );

        // Ensure auction is in flight
        require(
            _getNow() >= auctions[_tokenId].startTime && _getNow() <= auctions[_tokenId].endTime,
            "Auction.placeBid: Bidding outside of the auction window"
        );

        _placeBid(_tokenId, _bidAmount);

        emit BidPlaced(_tokenId, _msgSender(), _bidAmount);
    }

    /**
     * @notice withdraw funds which deposit by bidders
     * @dev Only callable when the auction is open
     * @dev Only callable by auction owner
     * @param _tokenId Token ID of the token being auctioned
     * @param _withdrawAmount withdraw amount which owner want to withdraw
     */
    function withdrawFunds(uint256 _tokenId, uint256 _withdrawAmount)
        external
        nonReentrant
        onlyCreatedAuction(_tokenId)
        onlyAuctionOwner(_tokenId)
    {
        require(
            availableFunds[_tokenId] >= _withdrawAmount,
            "Auction.withdrawFunds: not enough funds"
        );

        IERC20(auctions[_tokenId].fundTokenAddress).transfer(auctions[_tokenId].owner, _withdrawAmount);

        emit FundWithdrawn(_tokenId, _msgSender(), _withdrawAmount);
    }

    /**
     * @notice return funds which deposit by bidders
     * @dev Only callable when the auction is open
     * @dev Only callable by auction owner
     * @param _tokenId Token ID of the token being auctioned
     * @param _returnAmount return amount which owner want to return
     */
    function returnFunds(uint256 _tokenId, uint256 _returnAmount)
        external
        nonReentrant
        onlyCreatedAuction(_tokenId)
        onlyAuctionOwner(_tokenId)
    {
        require(
            IERC20(auctions[_tokenId].fundTokenAddress).balanceOf(auctions[_tokenId].owner) >= _returnAmount,
            "Auction.returnFunds: auction owner has not enough return amount"
        );

        IERC20(auctions[_tokenId].fundTokenAddress).transferFrom(auctions[_tokenId].owner, address(this), _returnAmount);

        emit FundReturned(_tokenId, _msgSender(), _returnAmount);
    }

    /**
     * @notice end Auction if time is over
     * @param _tokenId Token ID of the token being auctioned
     */
    function endAuction(uint256 _tokenId) 
        external 
        nonReentrant
        onlyCreatedAuction(_tokenId)
    {
        Auction memory auction = auctions[_tokenId];

        // Check the auction real
        require(
            auction.endTime > 0,
            "Auction.endAuction: Auction does not exist"
        );

        // Check the auction has ended
        require(
            _getNow() > auction.endTime,
            "Auction.endAuction: The auction has not ended"
        );

        // Ensure this contract is approved to move the token
        require(
            token.isApprovedForAll(auction.owner, address(this)),
            "Auction.endAuction: auction not approved"
        );

        Bid[] storage bidList = bids[_tokenId];
        require(bidList.length > 0, "Auction.endAuction: no bid exist");

        uint256 benefit;
        benefit = bidList[bidList.length - 1].actualBidAmount.mul(auctions[_tokenId].fee).div(100)
            .mul(_getNow().sub(auctions[_tokenId].startTime))
            .div(auctions[_tokenId].endTime.sub(auctions[_tokenId].startTime));
        uint256 returnFund = bidList[bidList.length - 1].actualBidAmount + benefit;

        if(availableFunds[_tokenId] < returnFund) {
            token.safeTransferFrom(address(this), bidList[bidList.length - 1].bidder, _tokenId);
        } else {
            IERC20(auctions[_tokenId].fundTokenAddress).transferFrom(address(this), bidList[bidList.length - 1].bidder, 
                returnFund);
        }

        // Clean up the highest bid
        delete bids[_tokenId];
        delete auctions[_tokenId];
        
        emit AuctionEnded(_tokenId);
    }

    /**
     * @notice Method for getting all info about the auction
     * @param _tokenId Token ID of the token being auctioned
     */
    function getAuction(uint256 _tokenId)
        external
        view
        onlyCreatedAuction(_tokenId)
        returns (Auction memory)
    {
        return auctions[_tokenId];
    }

    /**
     * @notice Method for getting all info about the bids
     * @param _tokenId Token ID of the token being auctioned
     */
    function getBidList(uint256 _tokenId) public view returns (Bid[] memory) {
        return bids[_tokenId];
    }

    /**
     * @notice Method for getting available funds by tokenId
     * @param _tokenId Token ID of the token being auctioned
     */
    function getAvailableFunds(uint256 _tokenId) public view returns (uint) {
        return availableFunds[_tokenId];
    }

    function _getNow() internal view virtual returns (uint256) {
        return block.timestamp;
    }

    function _createAuction(
        uint256 _tokenId,
        uint256 _startPrice,
        uint256 _startTimestamp,
        uint256 _endTimestamp,
        uint256 _fee,
        address _fundTokenAddress
    ) private {
        // Check the auction alreay created
        require(
            auctions[_tokenId].created == false,
            "Auction.createAuction: Auction has been already created"
        );
        // Check end time not before start time and that end is in the future
        require(
            _endTimestamp > _startTimestamp,
            "Auction.createAuction: End time must be greater than start"
        );
        require(
            _endTimestamp > _getNow(),
            "Auction.createAuction: End time passed. Nobody can bid"
        );

        // Setup the auction
        auctions[_tokenId] = Auction({
            owner: _msgSender(),
            startPrice: _startPrice,
            startTime: _startTimestamp,
            endTime: _endTimestamp,
            fee: _fee,
            fundTokenAddress: _fundTokenAddress, 
            created: true
        });

        token.safeTransferFrom(_msgSender(), address(this), _tokenId);
    }

    /**
     * @notice Used for placing bid with token id
     * @param _tokenId id of the token
     */
    function _placeBid(uint256 _tokenId, uint256 _bidAmount) private {
        Bid[] storage bidList = bids[_tokenId];
        uint256 bidAmount = _bidAmount;
        uint256 benefit;
        if (bidList.length != 0) {
            benefit = bidList[bidList.length - 1].actualBidAmount.mul(auctions[_tokenId].fee).div(100)
                .mul(_getNow().sub(auctions[_tokenId].startTime))
                .div(auctions[_tokenId].endTime.sub(auctions[_tokenId].startTime));
        }
        uint256 actualBidAmount = bidAmount + benefit;

        // Ensure bid adheres to outbid increment and threshold

        if (bidList.length != 0) {
            Bid memory prevHighestBid = bidList[bidList.length - 1];
            uint256 minBidRequired = prevHighestBid.actualBidAmount;
            require(
                bidAmount > minBidRequired,
                "Auction.placeBid: Failed to outbid highest bidder"
            );
        } else {
            require(
                actualBidAmount >= auctions[_tokenId].startPrice,
                "Auction.placeBid: Bid amount should be higher than start price"
            );
        }

        require(
            IERC20(auctions[_tokenId].fundTokenAddress).balanceOf(_msgSender()) >= actualBidAmount,
            "Auction.placeBid: bidder has not enough balance"
        );

        // assign top bidder and bid time
        Bid memory newHighestBid;
        newHighestBid.bidder = _msgSender();
        newHighestBid.bidAmount = bidAmount;
        newHighestBid.actualBidAmount = actualBidAmount;
        newHighestBid.bidTime = _getNow();
        bidList.push(newHighestBid);

        IERC20(auctions[_tokenId].fundTokenAddress).transferFrom(_msgSender(), address(this), actualBidAmount);

        availableFunds[_tokenId] += actualBidAmount;

        if (bidList.length > 1) {
            IERC20(auctions[_tokenId].fundTokenAddress).transfer(bidList[bidList.length - 2].bidder, 
                bidList[bidList.length - 2].actualBidAmount + benefit);
            availableFunds[_tokenId] -= (bidList[bidList.length - 2].actualBidAmount + benefit);
        }
    }

    function onERC721Received(address, address, uint256, bytes memory) public virtual override returns (bytes4) {
        return this.onERC721Received.selector;
    }
}

